import BoardComponent from "../BoardComponent";
import CellComponent from "../CellComponent";

function App() {
	return (
		<div className="App">
			<BoardComponent>
				<CellComponent />
				<CellComponent />
				<CellComponent />
				<CellComponent />
			</BoardComponent>
		</div>
	);
}

export default App;
